import React from 'react';
import CloseButton from './CloseButton';

class Revolution extends React.Component {
    constructor (props) {
        super(props);
        
        };

        render() {
            if (this.props.show) {
                return (
                <div id="contentContainer">
                    <div className="contentCanvas">
                    REVOLUTION PLUGS GO HERE
                    </div>
                    <a onClick={this.props.onClose} id="closeLink"><CloseButton id="close" /></a>

                <style jsx>
                    {`

                        #closeLink {
                            position: absolute;
                            width: 25px;
                            height: 25px;
                            cursor: pointer;
                            right: 5.5%;
                            top: 2%;
                        }
                        
                        #contentContainer {
                            margin-top: 130px;
                            height: 60vh;
                            margin-left: 5vw;
                            width: 90vw;
                            background-image: url('data:image/png;base64,');
                            background-color: rgb(192,192,192);
                            border-radius: 8px;
                            min-width: 450px;
                          }
                        
                          .contentCanvas {
                            margin: auto;
                            z-index: 15;
                          }
                        
                          #corpProList {
                            list-style-type: none;
                            font-size: 1.6em;
                        
                            width: 100%;
                            transform: translate(-5.3%, 11%);
                          }
                        
                          #corpPro1 {
                            margin: 0 0 10% 0;
                          }

                        `}
                    </style>
                </div>)
                } else {
                    return (null)
                };
        }
    }

export default Revolution;
